define(["jquery","jquery/ui"],function($){"use strict";$.widget('mage.creditCardType',{options:{typeCodes:['SS','SM','SO']},_create:function(){this.element.on('change',$.proxy(this._toggleCardType,this)).trigger('change');},_toggleCardType:function(){$(this.options.creditCardTypeContainer).toggle($.inArray(this.element.val(),this.options.typeCodes)!==-1);}});return $.mage.creditCardType;});